USE safe_explorer;

SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS employees, trains_and_teams, capacity, cadence, preferences, membership;
SET FOREIGN_KEY_CHECKS=1;
/** 
* Iteration 03: SAFe Explorer
* This will create the required tables for iteration 03
*/

-- Comes from excel
CREATE TABLE employees(
	employee_nbr INT UNSIGNED NOT NULL PRIMARY KEY, 
    last_name VARCHAR(20),
    first_name VARCHAR(20),
    city VARCHAR(20),
    country VARCHAR(5),
    managers_nbr INT UNSIGNED,
    email_address VARCHAR(40),
    cost_center VARCHAR(10),
    status VARCHAR(10),
    primary_team VARCHAR(10),
    FOREIGN KEY (managers_nbr) REFERENCES employees(employee_nbr)
); 

-- Comes from excel
CREATE TABLE trains_and_teams (
	team_id VARCHAR(25) NOT NULL PRIMARY KEY,
    type VARCHAR(5),
    name VARCHAR(50), 
    parent VARCHAR(25), -- Team_id
    FOREIGN KEY (parent) REFERENCES trains_and_teams(team_id)
);

-- System managed
CREATE TABLE membership (
	id INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    employee_nbr INT UNSIGNED,
    last_name VARCHAR(20),
    first_name VARCHAR(20),
    team_id VARCHAR(25),
    team_name VARCHAR(50),
    role VARCHAR(50),
    FOREIGN KEY (employee_nbr) REFERENCES employees(employee_nbr),
    FOREIGN KEY (team_id) REFERENCES trains_and_teams(team_id)
);

-- Comes from excel
CREATE TABLE cadence (
	sequence VARCHAR(20) NOT NULL PRIMARY KEY,
    program_increment VARCHAR(20),
    iteration VARCHAR(20),
    start_date DATE,
    end_date DATE,
    duration INT,
    notes VARCHAR(1000)
);

-- System managed
CREATE TABLE capacity (
	id INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    team_id VARCHAR(25),
    team_name VARCHAR(50),
    program_increment VARCHAR(20),
    iteration_1 TINYINT UNSIGNED,
    iteration_2 TINYINT UNSIGNED,
    iteration_3 TINYINT UNSIGNED,
    iteration_4 TINYINT UNSIGNED,
    iteration_5 TINYINT UNSIGNED,
    iteration_6 TINYINT UNSIGNED,
    total SMALLINT UNSIGNED
);

-- Comes from excel
CREATE TABLE preferences (
	id INT NOT NULL PRIMARY KEY,
    name VARCHAR(50),
    value SMALLINT
);

